INSERT INTO `t_fun_article` VALUES (1,'1','集腋成裘','城里新开了一家餐馆，你怀揣美食梦想前去体验。如果是一个人去，只能点少数的一两道菜，既无法多些体会新颖的菜式，那一两道菜也存在风险——可能会不符合口味而使你扫兴。有什么解决方案呢?最好和朋友们一起去分享。其实投资基金也与此有些类似。\n作为一种投资工具，证券投资基金把众多投资人的资金汇集起来，由基金托管人(例如银行)托管，由专业的基金管理公司管理和运作，通过投资于股票和债券等证券，获取收益。\n对于个人投资者而言，倘若你有1万元打算用于投资，但其数额不足以买入一系列不同类型的股票和债券，或者你根本没有时间和精力去挑选股票和债券，购买基金是不错的选择。例如申购某只开放式基金，你就成为该基金的持有人，上述1万元扣除申购费后折算成一定份额的基金单位。所有持有人的投资一起构成该基金的资产，基金管理公司的专业团队运用基金资产购买股票和债券，形成基金的投资组合。你所持有的基金份额，就是上述投资组合的缩影。\n专家理财是基金投资的重要特色。基金管理公司配备的投资专家，一般都具有深厚的投资分析理论功底和丰富的实践经验，以科学的方法研究股票、债券等金融产品，组合投资，规避风险。\n相应地，每年基金管理公司会从基金资产中提取管理费，用于支付公司的运营成本。另一方面，基金托管人也会从基金资产中提取托管费。此外，开放式基金持有人需要直接支付的有申购费、赎回费以及转换费，封闭式基金持有人在进行基金单位买卖时要支付交易佣金。','2020-01-06 14:35:39',NULL),(2,'2','关注你的风险承受能力','投资总是有风险的，基金投资亦是如此。你能承受多大的风险?这是基金投资过程中需要考虑的关键问题。 投资人通常要面临两种风险。首先，是因为短期波动而发生损失的风险。在市场不好的时候，股票可能一整年的收益率都是负的，而几个月或者几周内的波动就更大了;相应地，如果你的基金主要投资于股票，则其回报率波动也比较大。另一方面，债市也不能完全保证不赔钱。所以，投资人通常仅关注这样的风险。每天从电台和电视台收听收看市场是如何波动的，甚至成日趴在电脑前关注股价的波动。 但是，不要让对短期波动的担忧终日困扰你的身心，否则，你可能因此而忽略了另一种更大的风险：无法实现理财目标的风险。 在你实现理财目标的道路上，对于短期波动的担心会起什么作用呢?可能使你的投资更加保守。也可能使你根据基金以及其他证券短期内的业绩表现进行买卖而不是考虑如此买卖是否有助于实现理财目标，换而言之，只见树木不见森林。因此，需要权衡实现理财目标的重要程度和你可以承受的短期波动之间的关系。在考虑你能承受的短期波动程度时，不妨关注一些与投资相生相伴的特殊风险。风险是投资的副产品，当风险显现的时候，波动就产生了。但是通过分散投资，你就可以减少任何一项风险因素所带来的巨大冲击，从而缓解短期波动。 市场风险。市场风险取决于头寸在某一类资产或者行业的比重，比如你的投资在股票以及科技股上的比重，相应地，这类资产或者这类行业股票也存在赔钱的风险。因此，为了控制市场风险，你不妨把投资分散在不同的资产类型和不同的行业上，所谓不把鸡蛋放在同一个篮子里。 公司风险。对于个股来说，短期波动来源于上市公司的经营风险和股价风险。经营风险主要是影响公司经营和业绩等基本面的因素。股价风险则更多是与公司股票表现有关，例如与公司的净利润、现金流、销售收入相比，股价是偏高还是偏低。 经济风险。通货膨胀、利率变化、经济增长率等宏观经济因素的变化甚至仅仅是市场对其预期和传言，都会导致短期波动。这一点，相信国内投资人在今年宏观紧缩政策和加息的背景下已经深有感触。因此，为了限制经济风险，不妨投资一些受周期性影响较小的证券。 国家风险。不管你或者你的基金仅投资于国内股票及债券或者同时投资于几个国家的股票以及债券，你的组合头寸都呈现在所投资的国家风险面前。包括政治风险、经济地位、汇率风险等。为此，你可以从以下两个方面来分散风险。一方面，投资于不同国家或者地区的证券。另一方面，如果你仅投资于国内证券，就要考虑组合是否过度地依赖其中上市公司在某一个国家或地区的成功，例如上市公司的业务国际化程度。你的投资周期和投资目标将决定你对短期波动的承受程度。人非草木，面对波动，你不可能无动于衷。因此，要事先做功课，考虑什么样的短期波动导致你的反应可能影响理财目标的实现。然后，尽可能减少组合短期波动的可能性，例如在不同的市场和公司之间进行分散化投资。 最后，不妨回答以下几个问题，有助于提升你关于短期波动和风险的理念。 你能够承受组合一年的损失程度是多少? 你能够承受组合五年的损失程度是多少? 你可以承受单只基金或者单项投资的最高损失是怎样的? 你计划如何来分散投资? 你在决定是否将某只基金或者某项投资纳入组合之前，会对其做怎样的风险考察?','2020-01-06 14:58:48',NULL),(3,'2','如何衡量基金的过往风险','基金以往的风险有多高?这是在购买基金之前必须了解的问题之一。以下将介绍衡量基金风险最常见的两种工具—标准差和β系数。 标准差是指过去一段时期内，基金每个月的收益率相对于平均月收益率的偏差幅度的大小。基金的每月收益波动越大，那么它的标准差也越大。例如，基金A在过去36个月内每月的收益率都是1%，那么其标准差为0。基金B的月收益率是不断变化的，一个月是5%，下一个月是25%，再下一个月是-7%，那么基金B的标准差则大于基金A的标准差。而基金C每个月都亏损1%，其标准差也同样是为0。 实际上，标准差所量化的对象是投资组合收益的波动，而不是投资组合中的风险，因为标准差并没有体现基金的下行风险，即亏损的可能性。正如上例，尽管基金B的标准差较大，但其风险并不一定比基金C的风险大。换而言之，标准差大的基金可能没有下行风险，而仅仅是收益波动很大。因此，我们最好将标准差视为衡量收益波动的手段。 应当将基金的标准差与同类型基金或者业绩评价基准的标准差进行比较。因为单看标准差本身的绝对数字并不能直观地显示其含义。例如，7%的标准差比5%高，但这个数值对于某只基金来说，是高还是低呢? β系数衡量基金收益相对于业绩评价基准收益的总体波动性，是一个相对指标。β系数越高，意味着基金相对于业绩评价基准的波动性越大。β系数大于1，则基金的波动性大于业绩评价基准的波动性。反之亦然。 如果β系数为1，则市场上涨10%，基金上涨10%;市场下滑10%，基金相应下滑10%。如果β系数为1.1,市场上涨10%时，基金上涨11%,;市场下滑10%时，基金下滑11%。如果β系数为0.9,市场上涨10%时，基金上涨9%;市场下滑10%时，基金下滑9%。 值得注意的是，β系数能否有效衡量风险，很大程度受基金与业绩评价基准相关性的影响。如果将基金与一个不大相关的业绩评价基准进行比较，计算出来的β系数就没有意义。所以考察β系数时，应当同时考察另一个指标--R平方。 R平方为1，则基金与业绩评价基准是完全相关的。R平方为0，意味着两者是不相关的。R平方越低，β系数作为基金波动性指标的可靠性越低。R平方越接近1，β系数则越能体现基金的波动性。在晨星的基金评价体系中，同时列示了β系数和R平方。 用统计工具作为风险衡量指标，是一种较好的考察基金风险的的手段，但投资者应当记住，不能仅仅根据一个风险衡量指标来做决策。低的风险衡量指标并不能保证投资的百分之百安全，因为没有任何指标能完全准确地预测基金未来的风险。','2020-01-06 14:58:48',NULL),(4,'3','如何构建你的基金组合','为什么投资?投资要达到什么目标?需要多少资金?回答这些问题是投资过程的第一步，也是最艰难的一环。首先，个人的投资目标和风险承受能力可能不一致。例如，你需要借助激进的投资方式比如买进小盘成长型基金获取高收益以实现投资目标，却无法承受在一个季度内亏损20%的风险。这时，你必须接受这个风险水平或调整投资目标。其次，时间因素也有重要影响。如果投资目标是30年后退休养老，你就可承受较大的收益波动，因为可分散风险的期间较长，即使投资出现亏损，还有时间可以等待基金净值的回升。如果离投资目标为期不远，那么应注重保有已获得的收益，而不要为了赚取更多收益去冒险;应该多投资于债券基金、货币市场基金，少投资于股票基金。针对每个投资目标，投资者应选择三至四只业绩稳定的基金，构成核心组合，这是决定整个基金组合长期表现的主要因素。大盘平衡型基金适合作为长期投资目标的核心组合，至于短期投资目标的核心组合，短期和中期波动性较大的基金则比较适合。一种可借鉴的简单模式是，集中投资于几只可为你实现投资目标的基金，再逐渐增加投资金额，而不是增加核心组合中基金的数目。 制定核心组合时，应遵从简单的原则，注重基金业绩的稳定性而不是波动性，即核心组合中的基金应该有很好的分散化投资并且业绩稳定。投资者可首选费率低廉、基金经理在位期间较长、投资策略易于理解的基金。此外，投资者应时时关注这些核心组合的业绩是否良好。如果其表现连续三年落后于同类基金，应考虑更换。在核心组合之外，不妨买进一些行业基金、新兴市场基金以及大量投资于某类股票或行业的基金，以实现投资多元化并增加整个基金组合的收益。小盘基金也适合进入非核心组合，因为其比大盘基金波动性大。例如核心组合是大盘基金，非核心搭配则是小盘基金或行业基金。 但是，这些非核心组合的基金也具有较高的风险，因此对其要小心限制，以免对整个基金组合造成太大影响。在组合中持有多少基金为最佳?这并没有定律。需要强调的是，整个组合的分散化程度，远比基金数目重要。如果你持有的基金都是成长型的或是集中投资在某一行业，即使基金数目再多，也没有达到分散风险的目的。相反地，一只覆盖整个股票市场的指数基金可能比多只基金构成的组合更为分散风险。 投资人应定期观察组合中各基金的业绩表现，将其风险和收益与同类基金进行比较。如果在一段时期内例如三年，基金的表现落后于同类基金，应考虑更换。风险承受能力不强的投资人，可将投资在债券基金和股票基金之间重新配置。','2020-01-06 14:58:48',NULL);
